import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import NavDropdown from "react-bootstrap/NavDropdown";
import Form from "react-bootstrap/Form";
import Button from "react-bootstrap/Button";
class Navigation extends React.Component {
  render() {
    return (
      <Navbar bg="dark" expand="lg" variant="dark">
        <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Nav
          variant="tabs"
          activeKey="/home"
          onSelect={(selectedKey) => alert(`selected ${selectedKey}`)}
        >
          <Nav.Item>
            <Nav.Link href="link_1">MENU</Nav.Link>
          </Nav.Item>
          <Nav.Item>
            <Nav.Link href="Link_2">GALLERY</Nav.Link>
          </Nav.Item>
          <Nav.Item>
            <Nav.Link href="link_3">EXPLORE</Nav.Link>
          </Nav.Item>
          <NavDropdown title="DROPDOWN" id="collasible-nav-dropdown">
            <NavDropdown.Item href="xyz">Something</NavDropdown.Item>
            <NavDropdown.Item href="abc">Something else</NavDropdown.Item>
            <NavDropdown.Divider />
            <NavDropdown.Item href="#action/3.4">
              Separated link
            </NavDropdown.Item>
          </NavDropdown>
        </Nav>
        <Form inline>
          <Form.Control type="text" placeholder="search" className="mr-10" />
          <Button variant="outline-primary">Search</Button>
          <Button variant="primary">LOG IN</Button>{' '}
          <Button variant="success">SIGN IN</Button>{' '}
        </Form>
      </Navbar>
    );
  }
}
export default Navigation;
